import { TIRUtils } from "@/utils/algorithm/TIR";
// 监听主线程传来的消息
self.addEventListener('message',(e)=>{
    // heavyCalculation(e.data)
    self.postMessage(heavyCalculation(e.data))
})
// 处理数据
function heavyCalculation(data){
    return TIRUtils.getTIRResult(_.map(data, 'Value'))
}
